name: FHI2020_Stratified_Sampling
description: This dataset is based on data from Project FHI2020 and comprises images
  from PADs, each representing a specific API from a predefined list of 20 APIs and
  one of four possible quantities (20, 50, 80, 100). The dataset features multiple
  images of the same PAD, captured under varying illumination conditions and using
  different devices, each image uniquely identified by an image_id, while cards share
  a sample_id. To address the challenge posed by its unbalanced nature regarding API
  names and quantities, a stratified sampling approach was employed for data splitting.
  Specifically, the dataset was divided such that for each API, and within each quantity
  category of that API, 10% of the PADs(considering all their photographs) were allocated
  to the test set, ensuring a proportional representation across both developing and
  testing subsets. This method not only maintains the balance of API types and quantities
  but also ensures that all photographs of the same PAD are kept together, either
  in the developing or the test set, to prevent data leakage and promote model generalizability.There
  are no distractors included in this dataset.
